import React from 'react';
import {Container, Row, Col} from 'react-bootstrap'

function PageNotFound() {
  return (
    <Container>
      <Row>
        <Col>
          <p>Page not found... sorry</p>
        </Col>
      </Row>
    </Container>
  );
}

export default PageNotFound;
